import "./ExpenseItem.css";

function ExpenseItem() {
  return (
    <div className="expense-item">
      <div className="expense-item__date">March 28 2023</div>
      <div>
        <h2>Car Insurance</h2>
      </div>
      <div>$ 293.67</div>
    </div>
  );
}

export default ExpenseItem;
